import React from 'react';

const Settings = ({ theme, setTheme }) => {
  const handleGoogleSignIn = () => {
    // Implement Google Sign-In logic here
    console.log("Google Sign-In clicked");
  };

  const handleMicrosoftSignIn = () => {
    // Implement Microsoft Sign-In logic here
    console.log("Microsoft Sign-In clicked");
  };

  const handleEmailSignIn = () => {
    // Implement Email Sign-In logic here
    console.log("Email Sign-In clicked");
  };

  return (
    <div>
      <div id="settingsView">
        <h1>Settings</h1>

        {/* Account Settings */}
        <div>
          <h2>Account Settings</h2>
          <div id="authSection">
            <p>Sign in to sync your data across devices</p>
            <div className="auth-buttons">
              <button className="auth-btn google" onClick={handleGoogleSignIn}>
                <img src="C:\Users\Meher\Downloads\google logo.png" alt="Google" /> Sign in with Google
              </button>
              <button className="auth-btn microsoft" onClick={handleMicrosoftSignIn}>
                <img src="C:\Users\Meher\Downloads\microsoft logo.png" alt="Microsoft" /> Sign in with Microsoft
              </button>
              <button className="auth-btn email" onClick={handleEmailSignIn}>
                <img src="C:\Users\Meher\Downloads\gmail logo.png" alt="Email" /> Sign in with Email
              </button>
            </div>
          </div>
          <div id="userInfoSection">
            <div className="user-info">
              <div className="user-avatar" id="userAvatar">
                <img src="" alt="User  Avatar" id="userAvatarImg" />
              </div>
              <div>
                <div id="userDisplayName"></div>
                <div id="userEmail"></div>
              </div>
            </div>
            <button className="sign-out-btn" id="signOutBtn">Sign Out</button>
          </div>
        </div>

        {/* Data Management */}
        <div className="settings-section">
          <h2>Data Management</h2>
          <button className="btn btn-primary" id="exportDataBtn">Export Patient Data</button>
          <button className="btn btn-secondary" id="importDataBtn" style={{ marginLeft: "1rem" }}>
            Import Patient Data
          </button>
        </div>
      </div>
    </div>
  );
};

export default Settings;
